import { UPDATE_ACTION_BAR_TITLE } from "../actions/action-types";

const initialState = {
  pageName: "Dashboard",
};

export default function (state = initialState, action) {
  switch (action.type) {
    case UPDATE_ACTION_BAR_TITLE:
      return {
        ...state,
        pageName: action.payload,
      };
    default:
      return state;
  }
}
